import "./app.css"
function App() {
  return (
   <div className="container">
    <div className="brand-box">
<h1>Magic Form</h1>
<p>Build form in react</p>
    </div>
    <div className="magic-form">
      <Formik initialValues={{
        name:'',
        email:'',
        agree:false,
        favoriteColor:'',
      }}
      validationSchema={
        Yup.object({
name:Yup.string().required('Ad bosh ola')

        })
      }
      /><Formik/>
      </div>
   </div>
  );
}

export default App;
